/*Table structure for table `event_history` */

DROP TABLE IF EXISTS `event_history`;

CREATE TABLE `event_history` (
  `ID` int(5) NOT NULL AUTO_INCREMENT,
  `EventID` int(5) DEFAULT NULL,
  `TaskID` int(5) DEFAULT NULL,
  `Description` varchar(255) DEFAULT NULL,
  `DateTimeEvent` datetime DEFAULT NULL,
  `UserID` int(5) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `event_history` */

/*Table structure for table `eventmaster` */

DROP TABLE IF EXISTS `eventmaster`;

CREATE TABLE `eventmaster` (
  `EventID` int(5) NOT NULL AUTO_INCREMENT,
  `EventName` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `DateTimeStart` datetime DEFAULT NULL,
  `DateTimeEnd` datetime DEFAULT NULL,
  `UserID` int(5) DEFAULT NULL,
  `DateTimeCreated` datetime DEFAULT NULL,
  `UniqueID` varchar(50) COLLATE latin1_general_ci DEFAULT NULL,
  `Status` varchar(15) COLLATE latin1_general_ci DEFAULT 'In Progress',
  `Locked` char(1) COLLATE latin1_general_ci DEFAULT 'n',
  PRIMARY KEY (`EventID`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

