BEGIN
	DECLARE priv CHAR(1);
	SELECT 'y' INTO priv
		FROM userevent ue, userroles ur, rolepriv up 
		WHERE ue.EventID = pEventID
		AND ue.UserID = pUserID
		AND ue.UserID = ur.UserID
		AND ur.RoleID = up.RoleID
		AND up.RolePriv = 'Add Messages'
	;	
	IF priv = 'y' THEN
		INSERT INTO messages
		(Message,UserID,DateTimePosted,EventID,TaskID,MessageType)
		VALUES (pMessage,pUserID,sysdate(),pEventID,pTaskID,pMessageType);
	END IF;
    END */$$
DELIMITER ;

