/* Procedure structure for procedure `sp_taskmaster_add_dependencies` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_taskmaster_add_dependencies` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_taskmaster_add_dependencies`(IN pTaskID INT(5),IN pDependencyTaskID INT(5), pUserID INT(5))
BEGIN
	DECLARE priv CHAR(1);
	SELECT 'y' INTO priv
		FROM taskmaster tm, userevent ue, userroles ur, rolepriv up 
		WHERE tm.TaskID = pTaskID
		AND tm.EventID = ue.EventID
		AND ue.UserID = pUserID
		AND ue.UserID = ur.UserID
		AND ur.RoleID = up.RoleID
		AND up.RolePriv = 'Task Add Dependencies'
	;	
	IF priv = 'y' THEN
		REPLACE INTO taskdependencies(TaskID,DependencyTaskID) VALUES (pTaskID,pDependencyTaskID);
	END IF;
    END */$$
DELIMITER ;

